#
# Probe
#   (NOTE: FOR 'bltouch', probe config should be defined in printhead/extruder config)
[bed_mesh]
speed: 120
horizontal_move_z: 5
mesh_min: 10,40       ## NOTE: mesh_min and mesh_max points should include probe:x/y_offset values.
mesh_max: 165,170     ##   Example: For intended nozzle coordinate 3,5 and probe:y_offset=26 probe:x_offset=0 set mesh_min: 3,31
probe_count: 9,9
#relative_reference_index: 0
algorithm: bicubic
#move_check_distance: 3
#split_delta_z: .01
#adaptive_margin: 0

[safe_z_home]
speed: 100
#move_to_previous: true
home_xy_position: 90,90
z_hop: 3
#   Retracts the z axis before x, y homing to avoid dragging the nozzle.

# Specific Probe Config and Overrides
[include beacon3d.cfg]
#[include btt-eddy.cfg]
#[include boop.cfg]

# Load a default height map
#   NOTE: this is not the same as 'printer.configfile.settings['beacon'].default_model_name'
[delayed_gcode bed_mesh_init]
initial_duration: 5.0
gcode:
  BED_MESH_PROFILE LOAD=beacon-default


